  false,\n\t\"url\": null,\n\t\"notes\": \"These ESI data were collected, mapped,
  and digitized to provide environmental data for oil spill planning and response.
  The Clean Water Act with amendments by the Oil Pollution Act of 1990 requires response
  plans for immediate and effective protection of sensitive resources. The ESI data
  include information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. These data were released as a DVD product which
  consolidated the original California ESI atlases that were also previously archived
  at the NODC under the following accessions; Northern California, 2000 (accession
  number 0013175), Central California, 2006 (accession number 0013176), San Francisco
  Bay, 1998 (accession number 0013224), and Southern California, 2000 (accession number
  0013225).nnESI MAPS SHOULD NOT BE USED FOR NAVIGATIONAL PURPOSES. Source data used
  in the development of these regional atlases range from 1959 to 2009 with much of
  the data dated from the 1980s, 1990s, to 2009. Source data dates are extensively
  documented in the dataset metadata and include the following Central California,
  data range 2005-07, compiled 2007, Northern California data range 1959-2007, compiled
  2007, San Francisco data range 1976-1998, compiled 1998, and Southern California
  data range 1982-2009, compiled 2008-2010.nnThis atlas update adds data formats to
  those originally released to accommodate new technologies of digital mapping. The
  underlying data have not been updated since the atlas publication dates shown. Each
  ESI atlas listed is provided in a variety of GIS formats, including a personal Geodatabase
  for use with the ESRI ArcGIS product line. An .mxd file, created in ArcMap 9.3 is
  also included. This mapping document provides links to all of the data tables and
  symbolization of the layers using the standardized ESI colors and hatch patterns.
  Layer files are also supplied. These, together with the associated geodatabase,
  can be used in other mapping projects to define the symbology and links established
  in the original ESI .mxd file.nnThere are also PDF files of the printed maps. All
  of these are now formatted to have the back of the maps a part of the same document
  as the map itself. This eases printing and sharing of the maps and helps to assure
  that the maps are not distributed without the supporting data. Links from the index
  map will route the user to the relevant map page. The GIS data are also provided
  in ARC Export .e00 format, as shape files with an ArcView 3.x project and in MOSS
  format. Database files are included in text and .e00 format. Each area directory
  contains a readme file which shows the area of coverage and gives a bit more description
  of the various file formats included.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
